import './App.css';
import HeaderAppBar from './components/HeaderAppBar';
import { AuthContextProvider } from './components/contexts/AuthContext';
import Recommender from './components/recommendator/Recommender';



function App() {
  const stock = [{
    id: '1234',
    symbol: 'APOLO'
  }]
  return (
    <AuthContextProvider>
      <div className="App">
        <div className='header'>
          <HeaderAppBar/>
        </div>

        <div>
          <Recommender/>
        </div>


      </div>
    </AuthContextProvider>

  );
}

export default App;
